def main():
	n, m = list(map(int, input().split()))
	matrix = [list(map(str, input().split())) for _ in range(n)]
	r = [(0, 0)]
	for i in range(n):
		r.append((matrix[i][j], i, j))
	r.append((0, 0))
	status = ['YES'] * m
	for i in range(m):
		if '*' in matrix[i]:
			status[r[i][0]][r[i][1]] = 'NO'
			for j in range(i + 1, m):
				if '*' in matrix[j]:
					status[r[i][j]][r[i][1]] = 'NO'
					break
			if status[r[i][0]][r[i][1]] == 'NO':
				r.pop()
				break
	print('\n'.join(list(map(str, status))))


def __starting_point():
	main()

